const ChangePassword = (props) => {

    return (
        <div className="login-page">
            <h3></h3>
            <form className="add-form">
             <div id="mail">
                <input className="email" type="password" value={props.OldPassword} onChange={(e)=>props.handlePasswordChange(e)} id="password"  placeholder="Enter old Password" required />
            <input className="email" type="text" value={props.SecurityKey} onChange={(e)=>props.handlePasswordChange(e)} id="key"  placeholder = "Enter Security Key" required />
       
    <input className="email" type="password" value={props.NewPassword} onChange={(e)=>props.handlePasswordChange(e)} id="password"  placeholder="Enter New Password" required />
        </div>
        <div className="btn-container">
<button onClick={(e)=> props.changePasswordBtn(e)} type="submit"  className="proceed-btn">Change Password</button>
</div>
     </form>  
      </div>
      );
}


export default ChangePassword;
